sys_variable_value.value:
(function parse(inputs, outputs) {

var item = JSON.parse(inputs.sourceItem);
outputs.targetObject.name = item.name;
outputs.targetObject.id = item.id;
outputs.targetObject.city = item.city;
outputs.targetObject.state = item.state;
outputs.targetObject.country = item.country;
outputs.targetObject.postal_code = item.postal_code;
outputs.targetObject.website = item.website;
outputs.targetObject.type = item.brewery_type;
outputs.targetObject.latitude = item.latitude;
outputs.targetObject.longitude = item.longitude;
outputs.targetObject.phone = item.phone;

})(inputs, outputs);

(function execute(inputs, outputs) {
  var numberOfPages = parseInt(inputs.number_of_pages) - 1;
  outputs.starting_page = inputs.starting_page;
  outputs.number_of_pages = numberOfPages;
  outputs.number_of_records_per_page = inputs.number_of_records_per_page;
  outputs.last_page = parseInt(inputs.starting_page) + parseInt(numberOfPages);
})(inputs, outputs);

