sys_variable_value.value:
(function paginate(variables, pageResponse) {
    var starting_page = parseInt(variables.starting_page);
    var last_page = parseInt(variables.last_page);

    if (starting_page < last_page) {
        variables.getNextPage = true;
        variables.starting_page = starting_page + 1;
    } else {
        variables.getNextPage = false;
    }
   
})(variables, pageResponse);

